import './App.css';
import HomePage from './pages/homepage/homepage.component';
import {Route, Routes} from 'react-router-dom';

const HatsPage = () => (
  <div>
    <h1> Hats Page </h1>
  </div>
)

function App() {
  return (
    <div >
      <Routes>
      <Route path='/' element={<HomePage />} />

      </Routes>

      <HomePage />

    </div>
  );
}

export default App;
